CommonData.BannerCustomCSS:
#onetrust-banner-sdk {
    border-radius: 16px !important;
    outline: none !important;
    background: var(--color-CardBg) !important;
    box-shadow:  var(--shadow-shadow2)!important;
}

#onetrust-policy {
    margin-top: 0 !important;
}

#onetrust-policy .banner-header {
    display: none !important;
}

#onetrust-banner-sdk * {
    font-family: BinancePlex, Arial, sans-serif !important;
}

#onetrust-policy-title {
    padding-top: 25px !important;
    padding-bottom: 0 !important;
    font-size: 20px !important;
    line-height: 28px !important;
    color: var(--color-textPrimary) !important;
}

#onetrust-policy-text {
    font-size: 14px !important;
    line-height: 22px !important;
    padding-bottom: 24px !important;
    color: var(--color-textPrimary) !important;
}

#banner-options {
    padding: 0 !important;
}

.banner-actions-container > button {
    border-radius: 10px !important;
    font-size: 14px !important;
    font-weight: 500 !important;
    margin-right: 0 !important;
    color: var(--color-TextOnYellow) !important;
    background: var(--color-BtnBg) !important;

    border-color:var(--color-BtnBg) !important;
}

.cookie-setting-link {
    background: var(--color-CardBg) !important;
    font-size: 14px !important;
    font-weight: 500 !important;
    color: var(--color-textPrimary) !important;
}

#onetrust-button-group-parent {
    padding-left: 25px !important;
    padding-right: 25px !important;
    padding-bottom: 25px !important;
}

#onetrust-pc-btn-handler {
    margin-bottom: 0 !important;
    font-size: 14px !important;
    font-weight: 500 !important;
}
